import React from 'react';
import './header.scss';
import Logo from '../../Assets/Logo/Logo-brainflix.jsx'

const Header = () => {
    return (
        <header className = 'header'>
            <Logo className = 'header__logo'/>
            <input className = 'header__search'/>

        </header>
    );
}

export default Header;
